import React from 'react';

class Modal extends React.Component {

    openModal() {
        document.getElementById('myModal').style.display = "block";
      };

    render() {
        return(
            <div id="myModal" className="modal">

    <div className="modal-content">
      <span className="close cursor" onclick="closeModal()">&times;</span>
      <div className="modalSlides">
        <img src="./imgs/graphic-design/graphic-design-poster.png" alt="Graphic Design Seminar Flyer"  title="Graphic Design Seminar Flyer"/>
      </div>

      <div className="modalSlides">
        <img src="../imgs/graphic-design/mcf-events.png" alt="MCF Events Flyer" title="MCF Events Flyer"/>
      </div>

      <a class="prev" onclick="plusSlides(-1)">&#10094;</a>
      <a class="next" onclick="plusSlides(1)">&#10095;</a>

      <div className="caption-container">
        <p id="caption"></p>
      </div>

      <div style={{textAlign: 'center'}}>
        <span className="dot" onclick="currentSlide(1)"></span>
        <span className="dot" onclick="currentSlide(2)"></span>
        <span className="dot" onclick="currentSlide(3)"></span>
        <span className="dot" onclick="currentSlide(4)"></span>
        <span className="dot" onclick="currentSlide(5)"></span>
      </div>

    </div>
  </div>
        )
    }
}

export default Modal;
